  ["despairers"] = "<html><body><h1>despairers</h1><p>despairer<p></p>n.<p></p>despair的变形<p></p>despair<p></p>[di'spεə]<p></p>n.<p></p>绝望，失望，断念<p></p>令人失望的人(或物)，使人绝望的人(或物)<p></p>使竞争者望尘莫及的人(或物)<p></p>vi.<p></p>绝望，失望，失去希望，不抱希望，丧失信心(常与of连用)：<p></p>绝望，失望，失去希望，不抱希望，丧失信心(常与of连用)：<p></p>I despair of ever finding him again.<p></p>我对再找到他已丧失信心。<p></p>to despair of humanity<p></p>对人感到绝望<p></p>Don't despair.<p></p>别丧失信心。<p></p>vt.<p></p>[废语]对…绝望，对…失望，对…丧失信心，对…不寄予希望<p></p>短语:<p></p>abandon oneself to despair<p></p>自暴自弃，陷于绝望<p></p>(be) the despair of<p></p>令…毫无办法的人(或物)；令…望尘莫及的人(或物)<p></p>Despair gives courage to a coward.<p></p>[谚语]绝望会给懦夫以勇气。(或：人急造反，狗急跳墙。)<p></p>drive someone to despair(或desperation)<p></p>逼得某人走投无路；使某人陷入绝境<p></p>fall into despair<p></p>陷入绝望的境地<p></p>in despair<p></p>在绝望中，绝望地，陷入绝境，陷于绝望<p></p>the despair of my life<p></p>[口语]使我感到毫无办法的事(或人)<p></p>yield(或give way) to despair<p></p>陷于悲观失望</p></body></html>",
