  ["directest"] = "<html><body><h1>directest</h1><p>vt.<p></p>(用建议、指示、有益的情报等)指导，引导，指引，带领：<p></p>The general manager directed the company through a difficult time.<p></p>总经理带领公司渡过了难关。<p></p>规定…的方向；控制；操纵：<p></p>History is directed by a small number of great figures.<p></p>历史是由少数伟大人物指引着方向的。<p></p>管理；监督；处理：<p></p>He directs the affairs of the estate.<p></p>他管理(或负责)该庄园的事务。<p></p>He directs the activities of the club.<p></p>他管理俱乐部的活动。<p></p>指示；命令；指挥，指令；统帅；规定：<p></p>He directed us to leave the burning building.<p></p>他指示我们撤离燃烧着的大楼。<p></p>He directed the battle.<p></p>他指挥了那场战斗。<p></p>The police were directing the flow of traffic.<p></p>警察正在指挥交通。<p></p>导演(电影、戏剧、电视剧等)，当…的导演：<p></p>He directed three movies.<p></p>他导演了三部影片。<p></p>He directed five Shakespearean plays.<p></p>他导演了五部莎士比亚戏剧。<p></p>指挥(乐队、合唱队等)；领奏；领唱：<p></p>He directed an orchestra.<p></p>他指挥一个管弦乐队。<p></p>给(某人)指路(或引路、指示方向)：<p></p>She directed me to the post office.<p></p>她给我指明去邮局的路。<p></p>Can you direct me to the downtown?<p></p>请问到闹市区怎么走?<p></p>把…对准某一目标，指向或针对(某地或某物)；使向某个方向(或目标)移动(at，against，to，towards):<p></p>We directed radio waves around the globe.<p></p>我们向全球发射无线电波。<p></p>He directed his aim to us.<p></p>他把他的目标对准我们。<p></p>把(时间、精力、目光等)对准某一目标(或方向)，使…前朝某一目标(或结果)采取行动(或努力)(常与to或towards连用)：<p></p>He directed all his energies to the task.<p></p>他把全部精力都用于这项任务上。<p></p>He directed his efforts to improving living conditions.<p></p>他致力于改善生活条件。<p></p>针对某人(或某些人)说(话)，对(某人)讲(话)；提出(要求、意见等)；做出(手势、面部表情等)(against，at，to，towards):<p></p>He directed his remarks to the secretary.<p></p>他的话是对秘书说的。<p></p>Please direct your complaints to the chairman.<p></p>请向主席去提意见。<p></p>把(邮件等)寄至(某人或某地)；在(包裹、信封等邮件上)书写收件人的姓名、地址(与to，towards连用)：<p></p>She directed her package to her boy friend.<p></p>她在包裹上写上她男友的姓名地址。<p></p>She asked for her mail to be directed to her home address.<p></p>她要求把邮件寄到她家。<p></p>vi.<p></p>指示，发指示；命令，发命令：<p></p>He is not directing in the company any longer.<p></p>她不再在公司主事了。<p></p>给予指导，指导；引导<p></p>引路，当向导<p></p>当(或担任)导演，导演：<p></p>She wanted to give up acting and start directing.<p></p>她想放弃表演并开始导演电影。<p></p>领唱；领奏<p></p>[主美国英语]指挥乐队(或合唱队等)<p></p>adj.<p></p>径直的，笔直的，直线的，捷径的，不拐弯的，最近(或最短)的(路)<p></p>亲身的，亲自的，直接的，紧靠近的，接近的，紧密的，(来源、资料等)第一手的，原始的<p></p>必然的，当然的，不可避免的；随之发生的；作为直接原因(或后果)的<p></p>直截了当的；率直的，正直的，坦率的，坦白的，诚实的，老实的，真诚的<p></p>正好的，恰好的；截然的；绝对的，完全的<p></p>直系的<p></p>[通常作前置修饰语]【语法学】直接(引用)的<p></p>【政府】(选举)直接的；(政府等)由选民直接选举产生的；(决议等)由选民直接作出的<p></p>【音乐】原方向的；(音程或和弦)原位的<p></p>(染料)直接染色的；不需要媒染剂的<p></p>【逻辑学】直接的<p></p>【数学】<p></p>直接的[参较inverse]<p></p>(比例)正的<p></p>【天文学】<p></p>(天体)顺行的，在绕太阳转时天体轨道方向与地球的轨道方向相同的<p></p>看似在天体上按黄道十二宫的自然顺序的方向运行的，即由西向东的[参较retrograde]<p></p>【电学】直流电的<p></p>分配给某一特定机构、过程、工作等的，或由它们产生的<p></p>adv.<p></p>直接地；径直地<p></p>直截了当地；坦率地，率直地<p></p>正好；准确地<p></p>按直系关系<p></p>近义词:<p></p>command<p></p>. conduct</p></body></html>",
