  ["disguisements"] = "<html><body><h1>disguisements</h1><p>disguisement<p></p>n.<p></p>disguise的变形<p></p>disguise<p></p>[dis'ɡaiz]<p></p>vt.<p></p>(为隐瞒身份或迷惑别人而)改变外貌(或装束)，把(外表、声音等)伪装起来，把…假扮(或假装、乔装)起来，假扮，化装，把…假扮成：<p></p>The president was disguised as a peasant.<p></p>总统假扮成农民。<p></p>The enemy soldier disguised as civilian.<p></p>一名敌兵伪装成了平民。<p></p>伪装：<p></p>to disguise one's voice.<p></p>伪装自己的声音，掩藏自己的嗓音<p></p>Mary disguised her handwriting by writing with her left hand.<p></p>玛丽用左手写字以伪装自己的笔迹。<p></p>掩饰；隐瞒，隐藏，掩盖(…的存在，真相或性质)：<p></p>She tried to disguise her real feelings.<p></p>她试图掩饰自己的真实情感。<p></p>to disguise an emotion<p></p>掩饰感情<p></p>to disguise one's intentions<p></p>隐瞒自己的意图<p></p>[废语]损坏…的外形；使变形<p></p>n.<p></p>伪装衣，伪装物，掩饰物，用于隐瞒身份、性质或质量等的东西，用来伪装的东西(或行动)；化装服饰(或用具、设备)；欺骗性的外罩(或情况、举止等)<p></p>表演者的化装(或面具、服装)<p></p>伪装，假扮，化装<p></p>假装，佯装，做作，掩饰；伪装的行为；借口，托辞<p></p>伪装的方式(或形式、状态)<p></p>短语:<p></p>a blessing in disguise<p></p>见blessing<p></p>in disguise<p></p>伪装的；化装的，装扮的<p></p>in(或under) the disguise of<p></p>在…伪装下，伪装成，装扮成，以…为借口，在…的幌子下<p></p>make no disguise of<p></p>不掩饰…<p></p>throw off one's disguise(或mask)<p></p>摘下假面具，露出真面目<p></p>变形：<p></p>vt.<p></p>disguised<p></p>. disguising</p></body></html>",
